(function () {
  var sections = Array.from(document.querySelectorAll('section'));
  var display = document.querySelector('.maincontent');
  var footer = document.querySelector('footer');
  var inScroll = false;
  sections[0].classList.add('activeSection');

  var performTransition = function performTransition(sectionNumber) {
    if (inScroll === false) {
      inScroll = true;
      var position = sectionNumber * -100;
      display.style.transform = "translateY(".concat(position, "%)");
      sections[sectionNumber].classList.add('activeSection');
      sections.forEach(function (sect, i) {
        if (i !== sectionNumber && sect.classList.contains('activeSection')) {
          sect.classList.remove('activeSection');
          return null;
        }
      });
      setTimeout(function () {
        inScroll = false;
        updateActivePaginator();
      }, 1300);
    }
  };

  var isSection = function isSection(el) {
    return sections.indexOf(el) > -1;
  };

  var scrollViewport = function scrollViewport(direction) {
    var activeSection = sections.filter(function (s) {
      return s.classList.contains('activeSection');
    })[0];
    var nextSection = activeSection.nextElementSibling;
    var prevSection = activeSection.previousElementSibling;

    if (direction === 'next' && isSection(nextSection)) {
      performTransition(sections.indexOf(nextSection));
    }

    if (direction === 'prev' && isSection(prevSection)) {
      performTransition(sections.indexOf(prevSection));
    }
  };

  window.addEventListener('wheel', function (e) {
    var deltaY = e.deltaY > 0 ? 1 : -1;
    console.log(deltaY);
    if (deltaY === 1) scrollViewport('next');
    if (deltaY === -1) scrollViewport('prev');
  });
  window.addEventListener('keydown', function (e) {
    var DEPRECATED = ['INPUT', 'TEXTAREA'];
    var tagName = e.target.tagName;
    var key = e.key;

    if (!DEPRECATED.includes(tagName)) {
      if (key === 'ArrowDown') scrollViewport('next');
      if (key === 'ArrowUp') scrollViewport('prev');
    }
  });
  var tagLinks = document.querySelectorAll('[data-scroll-to]');
  tagLinks.forEach(function (link) {
    link.onclick = function (e) {
      e.preventDefault();
      var target = e.target.dataset.scrollTo;
      var reqSection = sections.filter(function (s) {
        return s.dataset.sectionId === target;
      })[0];
      performTransition(sections.indexOf(reqSection));
    };
  });
  var paginatorItems = Array.from(document.querySelectorAll('.paginator__item'));
  paginatorItems.forEach(function (item, i) {
    item.onclick = function (e) {
      performTransition(sections.indexOf(sections[i]));
    };
  });

  function updateActivePaginator() {
    paginatorItems.forEach(function (item) {
      return item.classList.remove('paginator__item--active');
    });
    var activeSection = sections.filter(function (s) {
      return s.classList.contains('activeSection');
    })[0];
    var indexOfActiveSection = sections.indexOf(activeSection);
    paginatorItems[indexOfActiveSection].classList.add('paginator__item--active');
  }
})();

