var formatTime = function formatTime(timeSecs) {
  var roundTime = Math.floor(timeSecs);
  var minutes = Math.floor(roundTime / 60);
  var seconds = roundTime - minutes * 60;

  var addZero = function addZero(num) {
    return num < 10 ? "0".concat(num) : num;
  };

  return "".concat(addZero(minutes), ":").concat(addZero(seconds));
};

var onPlayerReady = function onPlayerReady() {
  var interval;
  var estimateElem = document.querySelector('.player__duration-estimate');
  var completedElem = document.querySelector('.player__duration-completed');
  var playbackBtn = document.querySelector('.player__playback-button');
  var bar = document.querySelector('.player__playback');
  var durationInSeconds = Math.floor(player.getDuration());

  if (typeof interval !== 'undefined') {
    clearInterval(interval);
  }

  bar.onclick = function (e) {
    var clickedPos = e.layerX;
    var barWidth = getComputedStyle(bar).width.slice(0, -2);
    var newButtonPosPercent = clickedPos / barWidth * 100;
    var newPlaybackPos = player.getDuration() / 100 * newButtonPosPercent;
    playbackBtn.style.left = "".concat(newButtonPosPercent, "%");
    player.seekTo(newPlaybackPos);
  };

  interval = setInterval(function () {
    var completedSecs = player.getCurrentTime();
    var completedPercent = completedSecs / durationInSeconds * 100;
    playbackBtn.style.left = "".concat(completedPercent, "%");
    completedElem.textContent = "".concat(formatTime(completedSecs));
  }, 1000);
  estimateElem.textContent = "".concat(formatTime(durationInSeconds));
};

var onPlayerStateChange = function onPlayerStateChange(e) {
  /*
  -1 – воспроизведение видео не началось
  0 – воспроизведение видео завершено
  1 – воспроизведение
  2 – пауза
  3 – буферизация
  5 – видео находится в очереди
  */
  var showSplashScreen = function showSplashScreen(bool) {
    var splash = document.querySelector('.player__splash');
    var player = document.querySelector('#yt-player');

    if (bool) {
      splash.style.display = 'block';
      player.style.display = 'none';
    } else {
      splash.style.display = 'none';
      player.style.display = 'block';
    }
  };

  if (e.data === 1) {
    playerStartElem.classList.add('paused');
    playerStartElem.classList.remove('active');
    showSplashScreen(false);
  }

  if (e.data === 2) {
    playerStartElem.classList.remove('paused');
    playerStartElem.classList.add('active');
    showSplashScreen(true);
  }
};

