(function () {
  var prev = document.querySelector('.slider__move-btn-left');
  var next = document.querySelector('.slider__move-btn-right');
  var list = document.querySelector('.slider__list');
  var items = Array.from(document.querySelectorAll('.slide'));
  var current = 1;
  var step = 100;
  next.addEventListener('click', function () {
    if (current === 4) {
      current = -0;
    }

    items.forEach(function (el) {
      el.style.transform = "translateX(".concat(-current * 100, "%)");
      el.style.transition = '1s';
    });
    current++;
  });
  prev.addEventListener('click', function () {
    if (current === 0) {
      current = 4;
    }

    items.forEach(function (el) {
      el.style.transform = "translateX(-".concat(current * 100 - 100, "%)");
      el.style.transition = '1s';
    });
    current--;
  });
})();
